import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faMagnifyingGlass } from "@fortawesome/free-solid-svg-icons";
import Sidebar from './Sidebar';
import { useState , useEffect } from "react";
//import { getAuth, onAuthStateChanged } from "firebase/auth";
import { db } from '../firebase-config';
import { collection, getDocs } from 'firebase/firestore';
//const auth = getAuth();
var Doctors=[];
function Home () {
    const [search ,setSearch]=useState('');
    const [data, setData] = useState([]);
    useEffect(() => {
      const querySnapshot = getDocs(collection(db, "doctors")).then((querySnapshot) => {
        querySnapshot.forEach((doc) => {
          // doc.data() is never undefined for query doc snapshots
          console.log("Usersss",doc.id, " => ", doc.data());
          Doctors.push(doc.id);
          setData(Doctors);
          // setPatient(Users);
          // Alert.alert("LoggedIn as Doctor");
          // setDoc("False");
          console.log("SEARCH RESULTS==="+Doctors)
      });
    
      });
  
      
  }, []);


    function handleSubmit (e)
    { e.preventDefault()}   
    return (<>
    <Sidebar>
    <div className="search-main">
      <div className="search-heading">Search for doctor</div> 
            <div className="search">
                <input
                    className="search__input"
                    type="text"
                    id="search"
                    placeholder="Search here..."
                    //onKeyUp={handleSubmit} 
                    onChangeText={(text) => {
                      setSearch(text) }}
                      value={search}
                />
                <button className="search__button">
                    <FontAwesomeIcon icon={faMagnifyingGlass} />
                </button>
            </div> </div></Sidebar>
            </>
    )
    }
export default Home
